import axios from 'axios';

const path = `${process.env.HOST}:${process.env.PORT}/${process.env.API_VERSION}/auth`;

export const signInAction = () => axios
    .get(`${path}/signin`)
    .then(results => results)
    .catch(err => console.log(err));
